	public static function GetLevelInfoForXP($xp)
	{
		foreach (self::$level_infos as $info)
		{
			if ($xp >= $info['min_xp'] && $xp < $info['max_xp'])
			{
				$temp = $info;

				if ($temp['slot_group'] > self::$max_released_slot_group)
				{
					$temp['slots_unlocked_in_group'] = self::$slots_released_in_max_group;
					$temp['slot_group'] = self::$max_released_slot_group;
				}

				else if ($temp['slot_group'] == self::$max_released_slot_group)
				{
					if ($temp['slots_unlocked_in_group'] > self::$slots_released_in_max_group)
						$temp['slots_unlocked_in_group'] = self::$slots_released_in_max_group;
					$temp['slot_group'] = self::$max_released_slot_group;
				}

				return $temp;
			}
		}

		return null;
	}

	public static function GetLevelInfoForLevel($level)
	{
		foreach (self::$level_infos as $info)
		{
			if ($level == $info['level'])
			{
				$temp = $info;

				if ($temp['slot_group'] > self::$max_released_slot_group)
				{
					$temp['slots_unlocked_in_group'] = self::$slots_released_in_max_group;
					$temp['slot_group'] = self::$max_released_slot_group;
				}

				else if ($temp['slot_group'] == self::$max_released_slot_group)
				{
					if ($temp['slots_unlocked_in_group'] > self::$slots_released_in_max_group)
						$temp['slots_unlocked_in_group'] = self::$slots_released_in_max_group;
					$temp['slot_group'] = self::$max_released_slot_group;
				}

				return $temp;
			}
		}

		return null;		
	}

	public static function GetNextSlotAwardLevel($level)
	{
		foreach (self::$level_infos as $info)
		{
			if ($info['level'] > $level && $info['unlocks_slot'] == 1)
				return $info['level'];
		}

		return 9999;				
	}

	public static function GetNextSlotAwardByXP($xp)
	{
		$thisLevel = self::GetLevelInfoForXP($xp);
		
		foreach (self::$level_infos as $info)
		{	
			if ($info['max_xp'] > $xp && ($info['level'] != $thisLevel['level']) && $info['unlocks_slot'] == 1)
				return $info['min_xp'];
		}

		return 9999;				
	}

	public static function GetLastSlotAwardedByXP($xp)
	{
		$levelInfo = self::GetLevelInfoForXP($xp);

		if($levelInfo['unlocks_slot'] == 1 || $levelInfo['min_xp'] <= 0)
			return $levelInfo['min_xp'];
		else
			return self::GetLastSlotAwardedByXP($levelInfo['min_xp'] - 1);
	}

	public static function GetMaxDenomAmtForLevel($level)
	{
		$denomID = 0;

		foreach (self::$level_infos as $info)
		{
			if ($level == $info['level'])
			{
				$denomID = $info['max_denomination_id'];
				//Log::info("Found GetMaxDenomForevel " . $level . " and the value is: " . $denomID);
				break;
			}
		}

		return self::GetAmountForDenomID($denomID);
	}

